import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [sweets, setSweets] = useState([]);
  const [user, setUser] = useState(null);
  const [isLogin, setIsLogin] = useState(true);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [search, setSearch] = useState('');
  const [newSweet, setNewSweet] = useState({
    name: '',
    category: '',
    price: '',
    quantity: ''
  });

  // ================= LOAD DATA =================
  useEffect(() => {
    fetchSweets();

    const savedUser = localStorage.getItem('user');
    if (savedUser) {
      setUser(JSON.parse(savedUser));
    }
  }, []);

  // ================= FETCH SWEETS =================
  const fetchSweets = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/sweets');
      setSweets(response.data.sweets); // ‚úÖ FIXED
    } catch (error) {
      console.error('Error fetching sweets:', error);
    }
  };

  // ================= LOGIN =================
  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(
        'http://localhost:5000/api/auth/login',
        { email, password }
      );
      setUser(response.data.user);
      localStorage.setItem('user', JSON.stringify(response.data.user));
      alert('Login successful!');
    } catch (error) {
      alert('Login failed');
    }
  };

  // ================= REGISTER =================
  const handleRegister = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(
        'http://localhost:5000/api/auth/register',
        { email, password }
      );
      setUser(response.data.user);
      localStorage.setItem('user', JSON.stringify(response.data.user));
      alert('Registration successful!');
      setIsLogin(true);
    } catch (error) {
      alert('Registration failed');
    }
  };

  // ================= PURCHASE SWEET =================
  const handlePurchase = async (id) => {
    try {
      if (!user || !user.id) {
        alert('Please login first!');
        return;
      }

      const response = await axios.post(
        `http://localhost:5000/api/sweets/${id}/purchase`,
        {
          user_id: user.id,
          quantity: 1
        }
      );

      const total = response.data.purchaseDetails.totalPrice;
      alert(`‚úÖ Purchase successful!\nTotal Price: $${total}`);

      fetchSweets();
    } catch (error) {
      alert('Purchase failed');
    }
  };

  // ================= ADD SWEET (ADMIN) =================
  const handleAddSweet = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/api/sweets', newSweet);
      setNewSweet({ name: '', category: '', price: '', quantity: '' });
      fetchSweets();
      alert('Sweet added!');
    } catch (error) {
      alert('Failed to add sweet');
    }
  };

  // ================= DELETE SWEET =================
  const handleDelete = async (id) => {
    if (!window.confirm('Delete this sweet?')) return;

    try {
      await axios.delete(`http://localhost:5000/api/sweets/${id}`);
      fetchSweets();
      alert('Sweet deleted!');
    } catch (error) {
      alert('Delete failed');
    }
  };

  // ================= RESTOCK =================
  const handleRestock = async (id) => {
    try {
      await axios.post(`http://localhost:5000/api/sweets/${id}/restock`);
      fetchSweets();
      alert('Restocked!');
    } catch (error) {
      alert('Restock failed');
    }
  };

  // ================= SEARCH =================
  const handleSearch = async () => {
    try {
      const response = await axios.get(
        `http://localhost:5000/api/sweets?name=${search}`
      );
      setSweets(response.data.sweets); // ‚úÖ FIXED
    } catch (error) {
      console.error('Search failed');
    }
  };

  // ================= LOGOUT =================
  const handleLogout = () => {
    setUser(null);
    localStorage.removeItem('user');
    alert('Logged out!');
  };

  // ================= FILTER =================
  const filteredSweets = sweets.filter(
    (sweet) =>
      sweet.name.toLowerCase().includes(search.toLowerCase()) ||
      sweet.category.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="container">
      <header>
        <h1>üç¨ Sweet Shop Management System</h1>
        {user && (
          <p>
            Welcome, {user.email} {user.isAdmin ? '(Admin)' : ''}
          </p>
        )}
      </header>

      {!user ? (
        <div className="auth-section">
          <h2>{isLogin ? 'Login' : 'Register'}</h2>
          <form onSubmit={isLogin ? handleLogin : handleRegister}>
            <input
              type="email"
              placeholder="Email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <button type="submit">{isLogin ? 'Login' : 'Register'}</button>
          </form>
          <button onClick={() => setIsLogin(!isLogin)}>
            {isLogin ? 'Register' : 'Login'}
          </button>
        </div>
      ) : (
        <>
          <div className="search-bar">
            <input
              placeholder="Search sweets..."
              value={search}
              onChange={(e) => setSearch(e.target.value)}
              onKeyUp={handleSearch}
            />
            <button onClick={() => { setSearch(''); fetchSweets(); }}>
              Clear
            </button>
            <button onClick={handleLogout} style={{ background: 'red' }}>
              Logout
            </button>
          </div>

          {user.isAdmin && (
            <div className="admin-panel">
              <h2>Add Sweet</h2>
              <form onSubmit={handleAddSweet}>
                <input
                  placeholder="Name"
                  value={newSweet.name}
                  onChange={(e) =>
                    setNewSweet({ ...newSweet, name: e.target.value })
                  }
                  required
                />
                <input
                  placeholder="Category"
                  value={newSweet.category}
                  onChange={(e) =>
                    setNewSweet({ ...newSweet, category: e.target.value })
                  }
                  required
                />
                <input
                  type="number"
                  placeholder="Price"
                  step="0.01"
                  value={newSweet.price}
                  onChange={(e) =>
                    setNewSweet({ ...newSweet, price: e.target.value })
                  }
                  required
                />
                <input
                  type="number"
                  placeholder="Quantity"
                  value={newSweet.quantity}
                  onChange={(e) =>
                    setNewSweet({ ...newSweet, quantity: e.target.value })
                  }
                  required
                />
                <button type="submit">Add</button>
              </form>
            </div>
          )}

          <div className="sweets-grid">
            <h2>Available Sweets</h2>
            <div className="grid">
              {filteredSweets.map((sweet) => (
                <div key={sweet.id} className="sweet-card">
                  <h3>{sweet.name}</h3>
                  <p>Category: {sweet.category}</p>
                  <p>Price: ${sweet.price}</p>
                  <p>Stock: {sweet.quantity}</p>

                  <button
                    onClick={() => handlePurchase(sweet.id)}
                    disabled={sweet.quantity === 0}
                  >
                    {sweet.quantity === 0 ? 'Out of Stock' : 'Purchase'}
                  </button>

                  {user.isAdmin && (
                    <>
                      <button onClick={() => handleRestock(sweet.id)}>
                        Restock
                      </button>
                      <button onClick={() => handleDelete(sweet.id)}>
                        Delete
                      </button>
                    </>
                  )}
                </div>
              ))}
            </div>
          </div>
        </>
      )}

      <footer>
        <p>Sweet Shop Management System</p>
      </footer>
    </div>
  );
}

export default App;
